import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const DetailPortrait = () => {
  return (
    <View>
      <Text>DetailPortrait</Text>
    </View>
  )
}

export default DetailPortrait

const styles = StyleSheet.create({})
